import React from "react";
import { Button } from "semantic-ui-react";
import database from "../firebase";
function Users({ id, name, surname }) {

    const sil= ()=>
    {
       database.collection("users").doc(id).delete();
    }


  return (
    <div>
      {name} {surname} 
      <Button onClick={sil}>
        Sil
      </Button>
    </div>
    
  );
}

export default Users;
